import { Link } from "react-router-dom";

const RouterNv = () => {

    return (
        <>
            <ul>
                <li><link to="/">home</link></li>
                <li><link to="/p1">page1</link></li>
                <li><link to="/p2">page2</link></li>
            </ul>
        </>
    );
    
    }
    export default RouterNv;
